"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Cleft lip and cleft palate (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/cleft-lip-and-cleft-palate-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H25333018\">",
"      <span class=\"h1\">",
"       What are cleft lip and cleft palate?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Cleft lip and cleft palate are kinds of birth defects. A cleft lip is an opening or split in the upper lip. A cleft palate is an opening or split the roof of the mouth (called the palate). A baby can be born with 1 or both of these conditions.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H25333032\">",
"      <span class=\"h1\">",
"       What are the symptoms of cleft lip and cleft palate?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Some babies with a cleft lip have a small notch in their upper lip. Others have a larger opening or hole that goes all the way to the bottom of their nose (",
"      <a class=\"graphic graphic_figure graphicRef83213 \" href=\"mobipreview.htm?3/27/3505\">",
"       figure 1",
"      </a>",
"      ).",
"     </p>",
"     <p>",
"      A cleft palate can be in the front or back of the roof of the mouth, on one or both sides.",
"     </p>",
"     <p>",
"      Babies with these problems can have trouble nursing or drinking from a bottle. &nbsp;",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H25333047\">",
"      <span class=\"h1\">",
"       Is there a test for cleft lip and cleft palate?",
"      </span>",
"      &nbsp;&mdash;&nbsp;In some cases, a cleft lip can be seen on an ultrasound, an imaging test doctors use to check on the baby during pregnancy. An ultrasound creates pictures of the baby inside the uterus.",
"     </p>",
"     <p>",
"      It is more difficult to see a cleft palate on an ultrasound.",
"     </p>",
"     <p>",
"      If an ultrasound shows that your baby has a cleft lip or palate, the person doing the ultrasound will check the baby for other birth defects. Your doctor or midwife might suggest a test called &ldquo;amniocentesis.&rdquo; During amniocentesis, a doctor puts a needle into the mother&rsquo;s uterus and removes some of the fluid that is around the baby. The fluid is then tested to check for problems with the baby&rsquo;s genes.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H25333062\">",
"      <span class=\"h1\">",
"       How are cleft lip and cleft palate treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Most of the time, surgery can fix a cleft lip and a cleft palate. For cleft lip, doctors usually do surgery in the first few months of life, or at least before the child turns 1 year old. For cleft palate, doctors should do surgery before the child is 18 months old. But the timing of the surgery is different for every child. And some children might need more than one surgery.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H25333077\">",
"      <span class=\"h1\">",
"       Will my child have problems as he or she grows up?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Your child might need other surgeries as he or she grows. Even after surgery, children with cleft lip or cleft palate might have other problems, including:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Missing, extra, or crooked teeth &ndash; Many children need braces after their permanent teeth grow in.",
"       </li>",
"       <li>",
"        Trouble speaking - Some children need to work with a speech therapist to help them learn to speak clearly.",
"       </li>",
"       <li>",
"        Ear infections and hearing loss &ndash; For children who get many ear infections, the doctor might suggest placing a small tube in the eardrum. These tubes help prevent ear infections and might help the child hear better.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H25333092\">",
"      <span class=\"h1\">",
"       Can cleft lip and cleft palate be prevented?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Maybe. Women might be more likely to give birth to a child with a cleft lip or cleft palate if they do certain things during pregnancy, including:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Take certain medicines such as:",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      <ul class=\"hyphen-block\">",
"       <li>",
"        Medicines used to treat seizures",
"       </li>",
"       <li>",
"        <a class=\"drug drug_patient\" href=\"mobipreview.htm?41/59/42934?source=see_link\">",
"         Methotrexate",
"        </a>",
"        , which is used to treat cancer and other diseases",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Smoke cigarettes",
"       </li>",
"       <li>",
"        Drink alcohol",
"       </li>",
"       <li>",
"        Not get enough &ldquo;",
"        <a class=\"drug drug_patient\" href=\"mobipreview.htm?24/57/25492?source=see_link\">",
"         folic acid",
"        </a>",
"        ,&rdquo; a type of vitamin",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Women who are pregnant or planning to get pregnant should take a &ldquo;prenatal&rdquo; multivitamin that has at least 400 micrograms of",
"      <a class=\"drug drug_patient\" href=\"mobipreview.htm?24/57/25492?source=see_link\">",
"       folic acid",
"      </a>",
"      . They should not smoke or drink alcohol. They should also tell their doctor about any medicines they are taking. &nbsp;",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H25333107\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
"     <p>",
"      <a class=\"medical medical_basics\" href=\"mobipreview.htm?37/1/37907?source=see_link\">",
"       Patient information: How to plan and prepare for a healthy pregnancy (The Basics)",
"      </a>",
"     </p>",
