"      </a>",
"      <br/>",
"      <a class=\"medical medical_patient\" href=\"mobipreview.htm?19/19/19764?source=see_link\">",
"       Patient information: Urinary incontinence treatments for women (Beyond the Basics)",
"      </a>",
"     </p>",
"    </div>",
