"     </b>",
"     (Ketoprofen ER Oral)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     200 mg (100): $728.81",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     <b>",
"      Capsules",
"     </b>",
"     (Ketoprofen Oral)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     50 mg (100): $96.50",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     75 mg (100): $107.30",
"    </p>",
"   </div>",
"   <div class=\"block mop drugH1Div\" id=\"F5261263\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Monitoring Parameters",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     CBC, chemistry profile, occult blood loss, periodic liver function; renal function (urine output, serum BUN, creatinine)",
"    </p>",
"   </div>",
