"   <div class=\"block pha drugH1Div\" id=\"F185880\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Mechanism of Action",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Reversibly inhibits cyclooxygenase-1 and 2 (COX-1 and 2) enzymes, which results in decreased formation of prostaglandin precursors; has antipyretic, analgesic, and anti-inflammatory properties",
"    </p>",
"    <p style=\"text-indent:0em;margin-top:2em;\">",
"     Other proposed mechanisms not fully elucidated (and possibly contributing to the anti-inflammatory effect to varying degrees), include inhibiting chemotaxis, altering lymphocyte activity,  inhibiting neutrophil aggregation/activation, and decreasing proinflammatory cytokine levels.",
"    </p>",
"   </div>",
"   <div class=\"block phk drugH1Div\" id=\"F185897\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Pharmacodynamics/Kinetics",
"    </span>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Onset of action: Regular release: &lt;30 minutes",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Duration: Regular release: Up to 6 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Absorption: Almost complete",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Distribution: 0.1 L/kg",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Protein binding: &gt;99%, primarily to albumin; Hepatic impairment: Unbound fraction is approximately doubled",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Metabolism: Hepatic via glucuronidation; metabolite (inactive) can be converted back to parent compound; may have enterohepatic recirculation",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Bioavailability: ~90%",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Half-life elimination:",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Regular release: 2-4 hours; Renal impairment: Mild: 3 hours; moderate-to-severe: 5-9 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Extended release: ~3-7.5 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Time to peak, serum:",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Regular release: 0.5-2 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Extended release: 6-7 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Excretion: Urine (~80%, primarily as glucuronide conjugates)",
"    </p>",
"   </div>",
